        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.pruningRegTree.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">회귀 트리를 가지치기할 때 사용되는 비용 복잡성 측도에 대한 알파 값을 지정합니다. 알파 값이 클수록 트리가 작아집니다.</p></section>',
        "vaeua-gui-eua.usingTimeZones.help.tip.txt": "날짜가 여러 개인 경우 어떤 시간대를 선택할 수 있습니까?",
        "vaeua-gui-eua.sas.van.pageVisibility.hideLinks.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">이 페이지를 볼 수 없는 사용자에게 텍스트 링크를 표시할지의 여부를 지정합니다. </p><p class\\="xis-paragraph">이 옵션을 활성화하지 않으면, 액세스 권한이 없는 사용자가 텍스트 링크를 따라가려고 하는 경우에 알림 메시지가 표시됩니다.</p></section>',
