        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.useStopList.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">STOP 리스트를 사용합니다. STOP 리스트는 텍스트에서 제거하려는 낮은 수준의 정보 또는 관련없는 단어의 단순 컬렉션입니다. 해당 단어는 SAS 데이터셋으로 저장되어 CAS 서버에 로드되어야 합니다.</p></section>',
