        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.GradientBoosting.usedefaultvariable.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">기본 예측 개수를 사용하여 각 분할을 시도합니다. 기본값은 총 예측 개수입니다. 기본값을 사용하지 않으려면 각 분할에 시도할 예측 개수를 지정합니다.</p></section>',
        "vaeua-gui-eua.Properties.svm.defaultpenalty.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">기본 벌점 값을 사용합니다. 기본값은 1.0입니다.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighPageCount.help.aria.txt": "도움말. 이 옵션에 대한 추가 정보 ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.missingAssignment.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">후보 예측변수에 대해 결측값이 있는 관측값의 수가 지정된 최솟값보다 크거나 같으면 분할 후보를 탐색할 때 결측값이 별도의 값으로 처리됩니다.</p></section>',
        "vaeua-gui-eua.barSpacing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph"><span class\\="xis-windowItem">간격</span> 옵션은 막대 사이의 간격을 지정합니다.</p><p class\\="xis-paragraph">군집화된 그룹화 막대의 경우, 군집 사이에 간격이 표시됩니다. 군집 내의 개별 막대 사이에는 간격이 없습니다.</p></section>',
