        "vaeua-gui-eua.sas.van.ReportReview.HighCustomSortEntries.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">사용자 정의 정렬의 값 수를 줄여 다음 문제를 해결합니다. 예를 들어, 우선 순위가 낮은 문제를 해결하려면 사용자 정의 정렬에서 선택한 값 수를 25개 이하로 줄입니다.</p><p class\\="xis-paragraph">낮은 우선 순위\\: 25개보다 많은(&gt;25) 정렬 포함</p></section>',
