        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.cellWeight.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">문서별 용어 행렬에서 셀이 가중되는 방법을 제어합니다. 셀 가중은 문서별 용어 행렬에서 모든 엔트리에 적용되어 문서에서 반복되는 용어의 효과를 완화시키는 기능입니다.</p></section>',
