        "vaeua-gui-eua.Properties.assessment.useDefaultNumberOfBins.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">향상도 통계량 계산에 기본 구간 개수를 사용합니다.</p></section>',
