        "vaeua-gui-eua.Properties.svm.customToleranceValue.help.tip.txt": "이 옵션에 대한 추가 정보 ",
        "vaeua-gui-eua.ModelComparisonBasePropertiesView.percentile.field.label.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">향상도 관련 통계량을 계산하는 데 사용되는 백분위수 구간에 대한 깊이를 지정합니다. 해당 통계량은 관측 평균, 향상도, 누적향상도, 누적검출률 및 누적이벤트율을 포함합니다.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.linkType.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">노드 간의 링크에 방향이 있는지(단방향) 또는 없는지(양방향) 지정합니다. 링크 유형은 네트워크 측정 기준 계산에 영향을 줍니다. 링크 화살표가 표시되면 링크 유형에 따라 링크 화살표의 방향이 결정됩니다.</p></section>',
