        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.pcPlot.maxPolylines.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">평형좌표계 알고리즘에서 생성할 수 있는 최대 폴리라인 개수를 지정합니다. 이 값을 늘리면 보다 상세한 구간화가 가능합니다.</p></section>',
