        "vaeua-gui-eua.linearTickValueFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph"><span class\\="xis-windowItem">눈금 값 표시</span> 옵션은 X축에 눈금 표시 값을 맞추는 데 사용되는 방법을 지정합니다. <span class\\="xis-windowItem">자동으로 겹침 최소화</span> 또는 <span class\\="xis-windowItem">방향 고정</span>을 선택할 수 있습니다.</p><div class\\="xis-paragraph"><span class\\="xis-windowItem">자동으로 겹침 최소화</span> 옵션은 눈금 값이 겹치는 경우에만 적용됩니다. 다음 옵션을 지정할 수 있습니다. <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">일부 제거</span></td><td>일부 눈금 값을 제거합니다.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">45° 회전</span></td><td>모든 눈금 값을 45°로 비스듬히 회전시킵니다.</td></tr></table></div>                 </div><div class\\="xis-paragraph"><span class\\="xis-windowItem">방향 고정</span> 옵션은 항상 적용되며 값의 방향을 설정합니다. 다음 옵션을 지정할 수 있습니다. <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">수평</span></td><td>눈금 값을 가로로 표시합니다.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">45° 회전</span></td><td>모든 눈금 값을 45°로 비스듬히 회전시킵니다.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">45° 회전 후 제거</span></td><td>모든 눈금 값을 45°로 비스듬히 회전시킨 후 눈금 값을 제거합니다.</td></tr></table></div>                 </div></section>',
