        "vaeua-gui-eua.Properties.linearRegression.includeMissing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">결측값을 가진 관측값을 포함하도록 모델을 확장합니다. 연속 효과는 관측 평균으로 처리되며, 결측을 나타내는 지표 변수가 생성됩니다. 분류 효과는 결측값을 고유 레벨로 처리합니다. </p></section>',
