        "vaeua-gui-eua.Properties.recommendationsPlot.predictor.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">각 범주 변수에 대해 가장 추천되는 범주나 가장 낮게 추천되는 범주를 표시합니다. 예측변수를 선택하려면 먼저 하나 이상의 예측변수를 할당해야 합니다.</p></section>',
        "vaeua-gui-eua.Properties.neuralnetwork.standardizationMethodlabel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">측도 예측변수를 표준화하는 데 사용되는 방법을 지정합니다.</p></section>',
