        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.cluster.nClusters.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">생성할 군집 수를 지정하거나 ABC(정렬된 상자 기준) 방법을 사용하여 최적의 군집 수를 도출하도록 지정합니다.</p><p class\\="xis-paragraph">ABC 방법은 먼저 생성할 군집 수를 선택하고, 군집을 생성하고, 각 군집에 대한 차이통계량을 계산합니다. 그런 다음에는 각 군집을 중심으로 하는 참조 분포가 생성되고 각 참조 분포에 대한 차이통계량이 계산됩니다. 이 프로세스는 모든 잠재적 군집 수에 대해 반복됩니다. 군집과 참조 데이터 간 차이통계량의 총 차이를 최대화하는 군집의 수를 최적의 군집 수로 선택합니다.</p><p class\\="xis-paragraph">ABC 방법은 모든 입력변수가 측도 변수일 때만 사용할 수 있습니다.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighCustomCategoryEntries.help.tip.txt": "이 옵션에 대한 추가 정보 ",
