        "vaeua-gui-eua.Properties.neuralnetwork.l1.help.tip.txt": "이 옵션에 대한 추가 정보 ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.forest.usedefaultvariable.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">기본 예측 개수를 사용하여 각 분할을 시도합니다. 기본값은 총 예측 개수의 제곱근입니다. 기본값을 사용하지 않으려면 각 분할에 시도할 예측 개수를 지정합니다.</p></section>',
        "vaeua-gui-eua.Properties.partialdependence.numBins.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">부분종속성 도표의 측도 변수를 범주화하는 데 사용되는 구간 개수를 지정합니다.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.rapidGrowth.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">빠른 k-평균 탐색 알고리즘을 사용하며 구간 순서화를 무시합니다. 탐욕적 탐색(greedy search) 알고리즘을 사용하고 구간 순서화를 따르려면 이 옵션을 선택하지 마십시오. 구간화하지 않은 측도 반응변수는 분산을 선택 기준으로 사용합니다. 이 옵션이 선택되면, 범주 반응 및 구간화된 측도 반응은 이득비 기준을 사용합니다. 그렇지 않으면 절대 이득이 사용됩니다.</p></section>',
