        "vaeua-gui-eua.sas.van.control.initialValueSVS.help.aria.txt": "도움말. 이 옵션에 대한 추가 정보 ",
        "vaeua-gui-eua.Properties.bayesNet.naive.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">나이브 베이지안 네트워크 및 베이지안 네트워크 확장 나이브 베이지안 네트워크를 생성하려고 시도합니다. 나이브 베이지안 네트워크는 반응변수가 모든 예측변수에 대한 유일한 상위 항목이 되도록 지정합니다. 이는 반응변수에 따라 모든 예측변수의 조건부독립성을 가정합니다. 베이지안 네트워크 확장 나이브 베이지안 네트워크는 예측 노드가 베이지안 네트워크를 형성할 수 있도록 하여 나이브 네트워크를 확장합니다.</p></section>',
