        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.communityResolution.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">계산할 커뮤니티(로컬 노드 그룹화)의 상대적인 수를 지정합니다. 네트워크가 변경되면 커뮤니티가 동적으로 업데이트됩니다.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.factMac.nonnegativeFactorization.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">편향 항이 있는 음이 아닌 요인을 0으로 강제 설정합니다. 이를 통해 학습용 데이터가 너무 부족할 때 성능을 향상시킬 수 있습니다.</p></section>',
