        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.geo.cluster.color.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">군집의 데이터 값을 기반으로 군집에 색상을 지정합니다. 이 옵션은 <span class\\="xis-windowItem">색상</span> 데이터 역할이 할당된 경우에만 사용할 수 있습니다.</p></section>',
