        "vaeua-gui-eua.Properties.bayesNet.variableSelection.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">지정한 독립성검정통계량에 따라 다른 예측변수의 조건부독립성에 대해 각 예측변수를 검정합니다. <span class\\="xis-windowItem">변수 선택</span>을 선택하면 주어진 예측변수에서 반응변수와 조건부 독립인 예측변수를 기각합니다.</p></section>',
