        "vaeua-gui-eua.sas.van.ReportReview.NestedContainers.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">중첩 컨테이너를 방지하도록 리포트 레이아웃을 조정하여 다음 문제를 해결합니다. 예를 들어, 우선 순위가 높은 문제를 해결하려면 리포트 레이아웃에 중첩 컨테이너가 6개 이하여야 합니다.</p><p class\\="xis-paragraph">낮은 우선 순위\\: 2개보다 많은(&gt;2) 중첩 컨테이너 포함</p><p class\\="xis-paragraph">중간 우선 순위\\: 4개보다 많은(&gt;4) 중첩 컨테이너 포함</p><p class\\="xis-paragraph">높은 우선 순위\\: 6개보다 많은(&gt;6) 중첩 컨테이너 포함</p></section>',
