        "vaeua-gui-eua.Properties.predAuto.numFactors.help.tip.txt": "이 옵션에 대한 추가 정보 ",
        "vaeua-gui-eua.Properties.predAuto.showSubgroups.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">그룹을 계산하고 결과에 상위 3개 그룹 및 하위 3개 그룹을 표시합니다. 지정된 반응변수에 대해 여러 의사결정트리가 실행되며, 각 그룹은 이러한 의사결정트리 중에서 하나의 리프를 설명합니다.</p></section>',
        "vaeua-gui-eua.Properties.assessment.cutoff.help.aria.txt": "도움말. 이 옵션에 대한 추가 정보 ",
        "vaeua-gui-eua.Properties.logisticRegression.gradientConversion.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">최대 경사도 구성 요소에 대한 수렴 기준을 지정합니다.</p></section>',
        "vaeua-gui-eua.Properties.neuralnetwork.validateError.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">모델 학습을 완료하는 데 허용 가능한 최대 확인 오류를 지정합니다. 확인 오류가 지정한 목표 값보다 작으면 모델 학습을 종료합니다.</p></section>',
        "vaeua-gui-eua.Properties.bayesNet.prescreenPredictors.help.tip.txt": "이 옵션에 대한 추가 정보 ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.cluster.standardization.help.tip.txt": "이 옵션에 대한 추가 정보 ",
        "vaeua-gui-eua.discreteTickValueFitPolicy.help.tip.txt": "이 옵션에 대한 추가 정보 ",
        "vaeua-gui-eua.Distribution.label.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">반응변수를 모델링하는 데 사용되는 분포함수를 지정합니다.</p></section>',
        "vaeua-gui-eua.dataElementStyleRotation.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph"><span class\\="xis-windowItem">데이터 요소 스타일 회전</span> 옵션은 그래프 템플릿의 데이터 요소에 스타일을 할당하는 방법을 지정합니다. 예를 들어, 선 그래프에서 이 옵션은 색상, 선 패턴 및 표식을 사용하여 그래프에서 선을 구별하는 방법을 지정합니다. <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">자동</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">테마의 스타일 회전 설정을 사용합니다. 대부분의 SAS 테마는 <span class\\="xis-windowItem">먼저 모든 색상 회전</span> 설정을 사용합니다. High Contrast 테마는 <span class\\="xis-windowItem">모든 속성 회전</span> 설정을 사용합니다.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">먼저 모든 색상 회전</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">팔레트의 모든 색상이 사용될 때까지 단색 채우기, 실선 및 일관된 표식 모양을 표시합니다.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">모든 속성 회전</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">다양한 색상 외에도 다양한 채우기 패턴, 선 패턴 및 표식 모양을 표시합니다. 이 설정은 색맹인 사용자의 접근성을 향상시킬 수 있습니다.</p></dd></dl></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.ShareDialog.useGuestAccess.help.aria.txt": "도움말. 이 옵션에 대한 추가 정보 ",
        "vaeua-gui-eua.Properties.svm.sigmoidParameterOne.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Sigmoid 함수에 척도(계수) 파라미터를 지정합니다.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.communities.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">각 노드 군집 내에서 계산할 커뮤니티(로컬 노드 그룹화) 수를 지정합니다. 계산된 총 커뮤니티 수는 네트워크 구조와 크기에 따라 선택한 값보다 작을 수 있습니다.</p></section>',
