        "vaeua-gui-eua.Properties.models.usePartition.help.aria.txt": "도움말. 이 옵션에 대한 추가 정보 ",
        "vaeua-gui-eua.glm.linkFunction.label.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">일반화선형모델을 반응의 분포와 연결하는 데 사용되는 연결함수를 지정합니다.                 </p></section>',
        "vaeua-gui-eua.barLabelFitPolicy.help.tip.txt": "이 옵션에 대한 추가 정보 ",
        "vaeua-gui-eua.sas.van.views.layout.panels.SplitNodePanel.logWorth.definition.help.aria.txt": "도움말. 이 옵션에 대한 추가 정보 ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.extractNounGroups.help.tip.txt": "이 옵션에 대한 추가 정보 ",
        "vaeua-gui-eua.Properties.bayesNet.includeMissing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">범주형 예측변수는 결측값을 별도의 값으로 처리합니다. 연속형 예측변수는 결측값을 예측변수의 평균으로 바꿉니다. 베이지안 네트워크의 경우 결측값은 반응변수에 포함되지 않습니다.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.forceStrength.help.aria.txt": "도움말. 이 옵션에 대한 추가 정보 ",
        "vaeua-gui-eua.Properties.svm.defaultpenalty.help.tip.txt": "이 옵션에 대한 추가 정보 ",
        "vaeua-gui-eua.groupingScale.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph"><span class\\="xis-windowItem">그룹화 척도</span> 옵션은 그룹화된 막대 그래프를 척도화하는 방법을 결정합니다. 막대는 누적되거나 군집화됩니다. <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">실제 값</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">데이터의 값에 따라 막대 크기를 조정합니다. 예를 들어, 한 그룹의 막대 값이 50이고 다른 그룹의 막대 값이 500이라고 가정합니다. 이때 값이 500인 막대는 값이 50인 막대보다 10배 더 큽니다.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">그룹을 100%로 정규화</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">상대 척도를 사용하여 그룹을 나타냅니다. 그룹 내에서 각 막대는 해당 그룹의 백분율로 표시됩니다. 예를 들어, 그룹의 합계 값이 100이라고 가정합니다. 해당 그룹 내에서 막대 값이 50이면, 막대는 전체 그룹 높이의 50%가 됩니다.</p></dd></dl></div>                 </div><p class\\="xis-paragraph">그래프 개체에 오버레이된 그래프 요소가 포함된 경우에는 이 옵션을 사용할 수 없습니다. 격자에서 축에 대해 동일한 데이터 범위를 지정했을 때에도 이 옵션을 사용할 수 없습니다.</p></section>',
        "vaeua-gui-eua.connectOrder.help.aria.txt": "도움말. 이 옵션에 대한 추가 정보 ",
        "vaeua-gui-eua.properties.sankey.linkColor.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">링크가 속하는 경로, 링크가 시작되는 이벤트, 드롭 오프 링크인지에 따라 링크에 색상을 적용합니다.</p></section>',
