        "vaeua-gui-eua.Properties.linearRegression.variableSelection.maximumEffects.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">선택 프로세스의 반복 과정에서 모델에 있을 수 있는 최대 효과 수를 지정합니다.                 </p></section>',
