        "vaeua-gui-eua.Properties.neuralnetwork.distributionlabel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">측도 반응을 모델링하는 데 사용되는 분포함수를 지정합니다.</p></section>',
