        "vaeua-gui-eua.ReportDistribution.ChooseMicrosoftTeamsChannel.Available.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Teams 채널에 리포트를 배포하려면 해당 채널에 이메일 주소가 있어야 합니다.</p></section>',
        "vaeua-gui-eua.CalculatedItemUIMediator.scopes.scopedAggregation.help.tip.txt": "이 옵션에 대한 추가 정보 ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.slider.setFixedRange.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">슬라이더 끝점에 대한 <span class\\="xis-windowItem">최솟값</span> 및 <span class\\="xis-windowItem">최댓값</span> 옵션을 지정할 수 있습니다.</p><div class\\="xis-paragraph">다음 중 하나라도 true인 경우에는 이 옵션을 사용할 수 없습니다. <div class\\="xis-listUnordered"><ul><li class\\="xis-item">슬라이더에 대한 필터 또는 순위가 정의되어 있음</li><li class\\="xis-item">슬라이더가 필터 작업의 타겟임</li></ul></div>                 </div><div class\\="xis-note"><span class\\="xis-noteGenText">주\\:</span><span class\\="xis-windowItem">필터링된 개체의 집계된 데이터에 대해 작업</span> 옵션이 활성화된 경우, 이 옵션은 항상 활성화됩니다.</div></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.identifyTermRoles.help.aria.txt": "도움말. 이 옵션에 대한 추가 정보 ",
        "vaeua-gui-eua.sas.van.ReportReview.HighPageCount.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">페이지를 제거하여 다음 문제를 해결합니다. 예를 들어, 우선 순위가 중간인 문제를 해결하려면 리포트의 페이지 수를 12개 이하로 줄입니다.</p><p class\\="xis-paragraph">낮은 우선 순위\\: 리포트에 6개보다 많은(&gt;6) 페이지 포함</p><p class\\="xis-paragraph">중간 우선 순위\\: 리포트에 12개보다 많은(&gt;12) 페이지 포함</p></section>',
        "vaeua-gui-eua.react.sas.van.views.layout.panels.Properties.geo.region.placeholders.help.aria.txt": "도움말. 이 옵션에 대한 추가 정보 ",
        "vaeua-gui-eua.Properties.assessment.cutoff.help.tip.txt": "이 옵션에 대한 추가 정보 ",
        "vaeua-gui-eua.sas.van.Insights.outliers.help.tip.txt": "인사이트에 대한 추가 정보",
        "vaeua-gui-eua.Properties.predAuto.showGroups.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">결과에 모든 그룹을 리포팅합니다. 기본적으로 상위 3개 그룹과 하위 3개 그룹만 리포트됩니다. 이 옵션을 선택한 경우, <span class\\="xis-windowItem">높음</span> 탭 및 <span class\\="xis-windowItem">낮음</span> 탭 둘 다 모든 그룹을 표시하지만, 각 탭의 그룹은 다르게 정렬됩니다. 측도 반응의 경우, <span class\\="xis-windowItem">높음</span> 탭의 그룹은 가장 높은 평균 값에서 가장 낮은 평균 값으로 정렬되고, <span class\\="xis-windowItem">낮음</span> 탭의 그룹은 가장 낮은 평균 값에서 가장 높은 평균 값으로 정렬됩니다. 범주 반응의 경우, <span class\\="xis-windowItem">높음</span> 탭의 그룹은 선택한 이벤트 레벨의 가장 높은 백분율에서 가장 낮은 백분율로 정렬되고, <span class\\="xis-windowItem">낮음</span> 탭의 그룹은 선택한 이벤트 레벨의 가장 낮은 백분율에서 가장 높은 백분율로 정렬됩니다.</p></section>',
        "vaeua-gui-eua.Properties.neuralnetwork.activationlabel.help.aria.txt": "도움말. 이 옵션에 대한 추가 정보 ",
        "vaeua-gui-eua.Properties.linearRegression.variableSelectionCriterion.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">선택 중 고려 사항에 대한 효과를 순위화하고 최종 모델을 선택하는 데 사용되는 기준을 지정합니다.</p></section>',
        "vaeua-gui-eua.Properties.svm.kernellabel.help.aria.txt": "도움말. 이 옵션에 대한 추가 정보 ",
        "vaeua-gui-eua.Properties.gamNPLR.gradConv.help.tip.txt": "이 옵션에 대한 추가 정보 ",
        "vaeua-gui-eua.Properties.bayesNet.significanceLevel.help.tip.txt": "이 옵션에 대한 추가 정보 ",
        "vaeua-gui-eua.sas.van.ReportReview.HighDataSourceCount.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">데이터 소스를 제거하여 다음 문제를 해결합니다. 예를 들어, 우선 순위가 높은 문제를 해결하려면 리포트에 대한 데이터 소스 수를 9개 이하로 줄입니다.</p><p class\\="xis-paragraph">낮은 우선 순위\\: 3개보다 많은(&gt;3) 데이터 소스 사용</p><p class\\="xis-paragraph">중간 우선 순위\\: 6개보다 많은(&gt;6) 데이터 소스 사용</p><p class\\="xis-paragraph">높은 우선 순위\\: 9개보다 많은(&gt;9) 데이터 소스 사용</p></section>',
        "vaeua-gui-eua.sas.van.control.initialMaxValue.help.aria.txt": "도움말. 이 옵션에 대한 추가 정보 ",
